result:
.container {
  padding: 6px;

  .info {
    height: 80px;

    .label {
      margin-left: 10px
    }

    .run-button {
      width: 100%;
      height: 40px;
      font-size: 120%;
    }
  }

  .result {
    min-height: 600px;
    margin-top: 6px;

    .case-choose {
      display: flex;
      justify-content: space-between;

      .title {
        color: $parent-title-color;
        font-size: 1.1em;
        font-weight: 500;
      }
    }

    .loading-container {
      width: 100%;
      height: 600px;

      .progress {
        top: 40%;
        left: 50%;
        transform: translate(-50%,-50%);
      }
    }


  }
}
